        this.ratio = ratio;
    }

    var getRatio= function() {
        return netProfit;
    }

    var setNetProfit  = function(netProfit) {
        this.netProfit = netProfit;
    }

    return {
        get_id: get_id,
        set_id: set_id,
        getFirstName: getFirstName,
        setFirstName: setFirstName
